// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

interface ISwapRouter {
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);
    
    function getAmountsOut(
        uint amountIn, 
        address[] calldata path
    ) external view returns (uint[] memory amounts);
}

contract RemittanceContract is Ownable, ReentrancyGuard {
    // Custom Errors
    error InvalidSourceToken(address token);
    error InvalidAmount(uint256 amount);
    error InvalidRecipientAddress(address recipient);
    error InsufficientAllowance(address token, uint256 required, uint256 current);
    error SwapFailed(address sourceToken, address targetToken, uint256 amount);
    error TransferFailed(address token, address to, uint256 amount);

    ISwapRouter public swapRouter;
    address public stablecoin; // e.g., XSGD address
    
    // Storing remittance details
    struct Remittance {
        address sender;
        address recipient;
        address sourceToken;
        uint256 sourceAmount;
        address targetToken;
        uint256 targetAmount;
        uint8 status; // 0: pending, 1: processing, 2: completed, 3: failed
        uint256 timestamp;
    }
    
    mapping(uint256 => Remittance) public remittances;
    uint256 public remittanceCounter;
    
    // Fee structure
    uint256 public platformFeePercentage = 50; // 0.5% (in basis points)
    uint256 public constant MAX_FEE = 500; // 5% maximum fee
    
    // Pause mechanism
    bool public paused;
    
    // Events (unchanged)
    event RemittanceSent(
        uint256 indexed remittanceId,
        address indexed sender,
        address indexed recipient,
        address sourceToken,
        uint256 sourceAmount,
        address targetToken,
        uint256 targetAmount,
        uint256 timestamp
    );
    
    event RemittanceStatusUpdated(
        uint256 indexed remittanceId,
        uint8 status
    );
    
    event FeeUpdated(uint256 newFeePercentage);
    event RouterUpdated(address newRouter);
    event StablecoinUpdated(address newStablecoin);
    event Paused();
    event Unpaused();
    
    // Modifiers (unchanged)
    modifier whenNotPaused() {
        require(!paused, "Contract is paused");
        _;
    }
    
    constructor(address _swapRouter, address _stablecoin) Ownable(msg.sender) {
        if (_swapRouter == address(0)) revert InvalidSourceToken(_swapRouter);
        if (_stablecoin == address(0)) revert InvalidSourceToken(_stablecoin);
        
        swapRouter = ISwapRouter(_swapRouter);
        stablecoin = _stablecoin;
    }
    
    /**
     * Internal helper to safely transfer tokens
     */
    function _safeTransfer(IERC20 token, address to, uint256 amount) internal {
        bool success = token.transfer(to, amount);
        if (!success) {
            revert TransferFailed(address(token), to, amount);
        }
    }

    /**
     * Get conversion quote with improved error handling
     */
    function getConversionQuote(
        address sourceToken,
        uint256 amount
    ) external view returns (uint256) {
        if (sourceToken == address(0)) revert InvalidSourceToken(sourceToken);
        if (amount == 0) revert InvalidAmount(amount);

        if (sourceToken == stablecoin) {
            return amount;
        }
        
        address[] memory path = new address[](2);
        path[0] = sourceToken;
        path[1] = stablecoin;
        
        try swapRouter.getAmountsOut(amount, path) returns (uint[] memory amounts) {
            return amounts[1];
        } catch {
            revert SwapFailed(sourceToken, stablecoin, amount);
        }
    }
    
    /**
     * Calculate platform fee
     */
    function calculateFee(uint256 amount) public view returns (uint256) {
        return (amount * platformFeePercentage) / 10000;
    }
    
    /**
     * Send tokens with conversion
     */
    function sendWithConversion(
        address sourceToken,
        uint256 amount,
        address recipient
    ) external nonReentrant whenNotPaused returns (uint256) {
        // Enhanced input validation
        if (sourceToken == address(0)) revert InvalidSourceToken(sourceToken);
        if (amount == 0) revert InvalidAmount(amount);
        if (recipient == address(0)) revert InvalidRecipientAddress(recipient);

        // Check allowance explicitly
        IERC20 token = IERC20(sourceToken);
        uint256 currentAllowance = token.allowance(msg.sender, address(this));
        if (currentAllowance < amount) {
            revert InsufficientAllowance(sourceToken, amount, currentAllowance);
        }

        // Create remittance record
        uint256 remittanceId = remittanceCounter++;
        
        remittances[remittanceId] = Remittance({
            sender: msg.sender,
            recipient: recipient,
            sourceToken: sourceToken,
            sourceAmount: amount,
            targetToken: stablecoin,
            targetAmount: 0,
            status: 1, // Processing
            timestamp: block.timestamp
        });
        
        // Transfer tokens
        bool transferSuccess = token.transferFrom(msg.sender, address(this), amount);
        require(transferSuccess, "Token transfer failed");
        
        uint256 targetAmount;
        
        // If token is already stablecoin
        if (sourceToken == stablecoin) {
            uint256 fee = calculateFee(amount);
            targetAmount = amount - fee;
            
            _safeTransfer(IERC20(stablecoin), recipient, targetAmount);
        } else {
            // Approve router
            token.approve(address(swapRouter), amount);
            
            // Swap path
            address[] memory path = new address[](2);
            path[0] = sourceToken;
            path[1] = stablecoin;
            
            // Attempt swap
            try swapRouter.swapExactTokensForTokens(
                amount,
                1, // Minimum 1 wei to prevent revert
                path,
                address(this),
                block.timestamp + 300
            ) returns (uint[] memory amounts) {
                targetAmount = amounts[1];
                uint256 fee = calculateFee(targetAmount);
                targetAmount -= fee;
                
                _safeTransfer(IERC20(stablecoin), recipient, targetAmount);
            } catch {
                // Mark as failed and refund
                remittances[remittanceId].status = 3;
                emit RemittanceStatusUpdated(remittanceId, 3);
                
                _safeTransfer(token, msg.sender, amount);
                revert SwapFailed(sourceToken, stablecoin, amount);
            }
        }
        
        // Update and finalize remittance
        remittances[remittanceId].targetAmount = targetAmount;
        remittances[remittanceId].status = 2;
        
        emit RemittanceSent(
            remittanceId,
            msg.sender,
            recipient,
            sourceToken,
            amount,
            stablecoin,
            targetAmount,
            block.timestamp
        );
        
        emit RemittanceStatusUpdated(remittanceId, 2);
        
        return remittanceId;
    }
    
    /**
     * @dev Get remittance details by ID
     * @param remittanceId The ID of the remittance
     * @return The remittance struct
     */
    function getRemittance(uint256 remittanceId) external view returns (Remittance memory) {
        if (remittanceId >= remittanceCounter) revert InvalidAmount(remittanceId);
        return remittances[remittanceId];
    }
    
    /**
     * @dev Get remittance status by ID
     * @param remittanceId The ID of the remittance
     * @return The status of the remittance
     */
    function getRemittanceStatus(uint256 remittanceId) external view returns (uint8) {
        if (remittanceId >= remittanceCounter) revert InvalidAmount(remittanceId);
        return remittances[remittanceId].status;
    }
    
    // Admin functions
    
    /**
     * @dev Set the platform fee percentage (in basis points)
     * @param _feePercentage The new fee percentage
     */
    function setPlatformFee(uint256 _feePercentage) external onlyOwner {
        if (_feePercentage > MAX_FEE) revert InvalidAmount(_feePercentage);
        platformFeePercentage = _feePercentage;
        emit FeeUpdated(_feePercentage);
    }
    
    /**
     * @dev Set the swap router address
     * @param _swapRouter The new swap router address
     */
    function setSwapRouter(address _swapRouter) external onlyOwner {
        if (_swapRouter == address(0)) revert InvalidSourceToken(_swapRouter);
        swapRouter = ISwapRouter(_swapRouter);
        emit RouterUpdated(_swapRouter);
    }
    
    /**
     * @dev Set the stablecoin address
     * @param _stablecoin The new stablecoin address
     */
    function setStablecoin(address _stablecoin) external onlyOwner {
        if (_stablecoin == address(0)) revert InvalidSourceToken(_stablecoin);
        stablecoin = _stablecoin;
        emit StablecoinUpdated(_stablecoin);
    }
    
    /**
     * @dev Pause the contract
     */
    function pause() external onlyOwner {
        paused = true;
        emit Paused();
    }
    
    /**
     * @dev Unpause the contract
     */
    function unpause() external onlyOwner {
        paused = false;
        emit Unpaused();
    }
    
    /**
     * @dev Withdraw accumulated fees
     * @param token The token to withdraw
     */
    function withdrawFees(address token) external onlyOwner {
        uint256 balance = IERC20(token).balanceOf(address(this));
        if (balance == 0) revert InvalidAmount(balance);
        
        bool success = IERC20(token).transfer(owner(), balance);
        require(success, "Fee withdrawal failed");
    }
}

